export const APILINK = process.env.NODE_ENV === "development" ? "https://feed-qa.fastjobs.fun/" : "https://feed.fastjobs.sg/";

export function apilink() {
    if (process.env.NODE_ENV === "development") {
        return "https://feed-qa.fastjobs.fun/";
    } else {
        return "https://feed.fastjobs.sg/";
    }
};
